- input: "TEXT\x1CC00055582\x1CF3XA-20130405\x1C\x1CF3XA\x1CRE: Amended October Monthly
    Report (09/01/12-09/30/12 Response Due: 04/05/2013 1. The Amended Report disclosed
    additional receipts immediately upon discovering a software error. The error was
    not allowing certain transactions to file despite them being properly entered
    and reported in the software system.  The original report was reconciled with
    an outside CPA prior to filing.  The issue was not discovered until a year-end
    reconciling off the FEC website.  The correction required a deletion of each transaction
    and vendor and reentry, which was done immediately upon discovery.  The Committee
    has converted to a new reporting software, at roughly three times the cost, which
    should ensure there is not an issue in the future.  2. The Committee has made
    best efforts to obtain all required information from donors that exceed $200 in
    a calendar year and has reported any information received from such efforts. Every
    Committee solicitation has included a clear and conspicuous request for donor
    information, for information not provided, a follow up has been made that meets
    the best efforts requirement. Any information that has been received has been
    disclosed.  3. All communications disclosed on Schedule B for Line 30 (b) meet
    the conditions of exempt activity. The candidates' names are disclosed in the
    purpose line. The report has been amended to include the name in the candidate
    field.  4. Schedule H4, supporting Line 21(a) discloses payments for communications
    consultant. The payment was not made for any communications that clearly identifies
    a federal candidate and was properly disclosed on line 21 (a).\n"
